      <h3>Correo : alexsilverr2390@gmail.com</h3>
      <p> Pi de pokemon este proyecto esta creado con node.js,express y sequelize en el backend y el frontend esta vinculado con react y redux  en una page donde se muestra todos los pokemones y sus tipos </p>
       
